import React, {Component} from 'react';
import logo from './assests/logo.png';
import shopping_cart from './assests/shopping_cart.jpeg';
import profile_image from './assests/avatar.png';
import './navbar.css';
import { faBars } from '@fortawesome/free-solid-svg-icons'
import { faTimes } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class Navbar extends Component {
	state = {
		tags: ['Home','About us','Our Lands','Our Suppliers','Products', 'Contact Us'],
		isNavOpen: false,
	}
	render() {
		return (
			<div className="container">
				<nav className="navbar">
					<div className="menu">
						<FontAwesomeIcon icon={faBars} className={`bars ${this.state.isNavOpen? 'hide_icon' : 'show_icon'}`}fontSize='medium'  onClick={() =>  ( this.setState({ isNavOpen: true}))}/>
						<FontAwesomeIcon icon={faTimes} className={`cross ${this.state.isNavOpen? 'show_icon' : 'hide_icon'}`} fontSize='medium' onClick={() =>  ( this.setState({ isNavOpen: false  }))}/>
						<img src={logo} className="icon" alt="cannot find image"/>
					</div>
					<ul className={`links ${this.state.isNavOpen ? 'show' : 'hide' }`}> {this.state.tags.map (link => <li key={link}><a href="#" className="anchor">{link}</a></li>)} </ul>
					<div className="left-menu">
						<img src={shopping_cart} className="shopping_cart" alt="cannot find image"/>
						<img src={profile_image} className="avatar" alt="cannot find image"/>
					</div>
				</nav>
			</div>
		  );
	}
}
export default Navbar ;
